  content: "## Search strategy collected\n  You now have a search strategy and a plan for what terms you will use to get the best results from your searching.\n\n  You're ready to get researching.",
  optionText: 'Collect your strategy and put it in your backpack',
  choices: ['to_the_google', 'to_the_library']
